import './App.css';
import '../src/Dashboard.jsx/Dashboard'
import Dashboard from './Dashboard.jsx/Dashboard';
import { Routes,Route } from 'react-router-dom';
import Search from './Dashboard.jsx/Search';
import Banners from './Dashboard.jsx/Banners';
import Home from './Dashboard.jsx/Home';

function App() {
  return (
    <>
    <Dashboard/>
    <Routes>
     <Route path= "/" element={<Search/>}/>
     <Route path= "/bags" element={<Search/>}/>
     <Route path= "/kids" element={<Search/>}/>
     <Route path= "/mens" element={<Search/>}/>



    </Routes>
    <Home/>

    </>
  );
}

export default App;
